            "</svg>\n<a href='https://vk.com/homelesstory'><bold>Бездомная история</bold></a> рассказывает истории жизни бездомных людей и говорит о том, как и почему они живут на улице и как жили до этого. Среди бездомных много интересных и образованных людей, которые из-за каких-то обстоятельств, на которые они не в силе повлиять, оказались на улице. Не все они пьяницы, просто дурно пахнущие люди или бездельники. В рамках проекта проходит сбор одежды для бездомных и других нужных вещей, которые нужны оказавшимся в трудной ситуации.",
